import React from "react";
import "./Footer.css";

function Footer() {
    return (
        <>
            <div className="footer">
                <p>&copy; 2024 Book Tracker</p>
                <nav>
                <a href="/contact">Contact</a>
                <a href="/about">About</a>
                </nav>
            </div>
        </>
    );
}

export default Footer;
